css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("22tracks.com") {

/* Dark BG {background: #222 !important; color: #666 !important;} */
html,
body,
div
    {background: #222 !important; color: #666 !important;}

/* Black BG {background: #111 !important; color: #666 !important;} */
div.genre-info,
div.info .description,
.player,
div.controls
    {background: #111 !important; color: #777 !important;}

/* Font Color */
div.controls .title 
    {color: #777 !important;}
}
